import { DUMMY_MEALS } from "./MealsDummy";
import MealsStyles from '../styles/Meals.module.css'

const MealsMenu = () => {
    const showAvailMeals = DUMMY_MEALS.map((meals) => (<li key={meals.id}>{meals.name}</li>))
    return (
        <section className={MealsStyles.meals}>
            <ul>
                {showAvailMeals}
            </ul>
        </section>
    )
}

export default MealsMenu;
